ÔÉ∞	Dalam masa kegelapan, kekelaman dan krisis di akhir zaman ini ada orang yang hanya melihat bahaya dan dampak yang ditimbulkan dari masa kesukaran itu. Sebagai orang percaya kita adalah terang dunia yang harus memancarkan terang Kristus bagi dunia, krisis bagi kita adalah kesempatan-kesempatan, yang pertama, untuk mengingat Tuhan kembali, dibalik semua masalah yang kita hadapi Tuhan akan memulihkan dan memberi yang terbaik dari apa yang pernah hilang dalam hidup kita ‚Äì perumpamaan anak yang hilang (Luk. 15)  diberi jubah terbaik, dikenakan cincin pada jarinya, kasut pada kakinya dan dibuatkan pesta. Kedua, kesempatan terus lakukan bagian kita dengan sungguh-sungguh. Tuhan akan mengerjakan bagian-Nya yang jauh lebih dahsyat dan ajaib, menjadi berkat bagi duni. Karena ‚Äúbangsa-bangsa berduyun-duyun datang kepada terangmu, dan raja-raja kepada cahaya yang terbit bagimu (ay. 3). Kita akan menjadi saksi dan terang yang SEMAKIN BERCAHAYA di tengah kegelapan dunia saat ini. Amin. Pdt Naftali Budi K
